  

// TypeScript Version: 4.1

/**
* Evaluates the identity function for double-precision floating-point number `x`.
*
* @param x - input value
* @returns input value
*
* @example
* var v = identity( -1.0 );
* // returns -1.0
*
* @example
* var v = identity( 2.0 );
* // returns 2.0
*
* @example
* var v = identity( 0.0 );
* // returns 0.0
*
* @example
* var v = identity( -0.0 );
* // returns -0.0
*
* @example
* var v = identity( NaN );
* // returns NaN
*/
declare function identity( x: number ): number;


// EXPORTS //

export = identity;
